import React, { Component } from 'react'
import "./Slide.css"
import SlideChild from './SlideChild'

class Slide extends Component {
  render() {
    return (
      <div className='slide'>
          <SlideChild skill1="HTML" skillImg="https://img1.freepng.fr/20180322/iuw/kisspng-web-development-html-logo-world-wide-web-consortiu-create-html-signature-5ab4731a64e900.6118207815217753864133.jpg"/>  
          <SlideChild kill2="JavaScript" skillImg="https://dama.ink/static/media/javascript.fd46ca41839433d73577989d86eb2fe2.svg"/>  
          <SlideChild skill3="Java" skillImg="https://brandslogos.com/wp-content/uploads/images/large/java-logo-1.png"/>  
          <SlideChild skill4="React" skillImg="https://dama.ink/static/media/react.e27571eaed899c642345e71163624ef9.svg"/>  
      </div>
    )
  }
}

export default Slide
